    "title": "Confusion Matrix",
    "facet": {
        "field": "rev",

    },
    "spec": {
        "transform": [
            {
                "aggregate": [
                    {
                        "op": "count",
                        "as": "xy_count"
                    }
                ],
                "groupby": [
                    "predicted",
                    "actual"
                ]
            },
            {
                "impute": "xy_count",
                "groupby": [
                    "rev",
                    "predicted"
                ],
                "key": "actual",
                "value": 0
            },
            {
                "impute": "xy_count",
                "groupby": [
                    "rev",
                    "actual"
                ],
                "key": "predicted",
                "value": 0
            },
            {
                "joinaggregate": [
                    {
                        "op": "max",
                        "field": "xy_count",
                        "as": "max_count"
                    }
                ],
                "groupby": []
            },
            {
                "calculate": "datum.xy_count / datum.max_count",
                "as": "percent_of_max"
            }
        ],
        "encoding": {
            "x": {
                "field": "actual",
                "type": "nominal",
                "sort": "ascending",
                "title": "True Label"
            },
            "y": {
                "field": "predicted",
                "type": "nominal",
                "sort": "ascending",
                "title": "Predicted Label"
            }
        },

                        "title": "",
                        "scale": {

                            "nice": true
                        }
                    }
                }
            },
            {

                        "on": "mouseover",
                        "encodings": [
                            "x",
                            "y"
                        ],
                        "empty": "none",
                        "clear": "mouseout"
                    }
                },
                "mark": "rect",
                "encoding": {
                    "tooltip": [
                        {
                            "field": "actual",
                            "type": "nominal"
                        },
                        {
                            "field": "predicted",
                            "type": "nominal"
                        }
                    ],
                    "opacity": {
                        "condition": {
                            "selection": "label",
                            "value": 1
                        },
                        "value": 0
                    }
                }
            },
            {
                "transform": [
                    {
                        "filter": {
                            "selection": "label"
                        }
                    }
                ],

                        "mark": {

                        }
                    }
                ]
            },
            {
                "mark": "text",
                "encoding": {
                    "text": {
                        "field": "xy_count",
                        "type": "quantitative"
                    },
                    "color": {
                        "condition": {
                            "test": "datum.percent_of_max > 0.5",
                            "value": "white"
                        },
                        "value": "black"
                    }
                }
            }
        ]
    }
